import logo from './logo.svg';
import './App.css';
import Today from './components/Today';
import Category from './components/Category';

function App() {
  return (
    <main>
      <div className="Header">
        <Today />
      </div>
      <section className="Category">
        <Category />
      </section>
    </main>
  );
}

export default App;
